    PAC and the ICGA PAC are not affiliated.  The ICGA PAC has its own board and makes
    its own financial and administrative decisions.  The NCGA does not control and
    is not controlled by the ICGA PAC financially, administratively or otherwise.
    There is no significant or ongoing transfer of funds between the NCGA PAC and
    the ICGA PAC.\n"
